import React from "react";
import { Grid, Item } from "@mui/material";


const Header = () => {
    return (
        <Grid container spacing={2}>
            <Grid item xs={12}>
                <Item>Menu</Item>
            </Grid>
        </Grid>
    )
}

export default Header;
